import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class App extends Component {
    render(){
        return(
            <div>
                <h1>App</h1>
                <ul>
                    <li><Link to="/about">about</Link></li>
                    <li><Link to="/help">help</Link></li>
                </ul>
            </div>
        )
    }
}

export default App;
